import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import React from "react";
import "./Login.css";

function Signup() {
    const handleSubmit = async () => {
        const formData = {
            user_name: "exampleUsername",
            full_name: "exampleFullName",
            email: "example@email.com",
            phone_number: "1234567890",
            user_password: "examplePassword",
        };

        try {
            const response = await fetch("http://localhost:4000/adduser", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify(formData),
            });

            if (response.ok) {
                console.log("Data saved successfully");
            } else {
                console.error("Failed to save data");
            }
        } catch (error) {
            console.error("Error:", error);
        }
    };

    return (
        <form action="/adduser" method="post">
            <div className="Sign">
                <div className="signup">
                    <div className="row">
                        <h3 style={{ marginBottom: "30px" }}>SignUp</h3>
                        <div className="col-sm-12 col-md-6 col-lg-6 signupcon">
                            <input className="form-control signupcon" type="text" name="full_name" placeholder="Enter Full Name" />
                        </div>
                        <div className="col-sm-12 col-md-6 col-lg-6 signupcon">
                            <input className="form-control" type="text" name="user_name" placeholder="Enter User Name " />
                        </div>
                        <div className="col-sm-12 col-md-12 col-lg-12 signupcon">
                            <input className="form-control" type="text" name="email" placeholder="Enter Your Email Here..." />
                        </div>
                        <div className="col-sm-12 col-md-12 col-lg-12 signupcon">
                            <input className="form-control" type="text" name="phone_number" placeholder="Enter Your Phone Number Here... " />
                        </div>

                        <div className="col-sm-12 col-md-6 col-lg-6 signupcon">
                            <input className="form-control signupcon" type="text" name="user_password" placeholder="Password" />
                        </div>
                        <div className="col-sm-12 col-md-6 col-lg-6 signupcon">
                            <input className="form-control signupcon" type="text" placeholder="Conform Password" />
                        </div>
                        <div>
                            <button type="button" className="btn btn-primary" onClick={handleSubmit}>
                                Submit
                            </button>

                        </div>
                    </div>
                </div>
            </div>


        </form>
    );
}

export default Signup;





